import React from 'react';

const Education = () => (
  <div>
    <h2>Education</h2>
    <p>
      Bachelor of Science in Computer Science, University of XYZ (2016 - 2020).
      <br />
      Courses include Data Structures, Algorithms, Web Development, and more.
    </p>
  </div>
);

export default Education;
